import React, { useRef } from "react";
import "../styles/GenerateQRCode.css";

const GenerateQRCodePage = ({ hotelId = 123 }) => {
  // Fix: Use window.location.origin to generate correct QR code URL for your deployed frontend
  const menuUrl = `${window.location.origin}/menu`;
  const qrUrl = `https://api.qrserver.com/v1/create-qr-code/?data=${encodeURIComponent(menuUrl)}&size=200x200`;
  const imgRef = useRef(null);

  const handleDownload = async () => {
    // Fetch the image as a blob and trigger download
    try {
      const response = await fetch(qrUrl);
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement("a");
      link.href = url;
      link.download = "menu-qr-code.png";
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      window.URL.revokeObjectURL(url);
    } catch (err) {
      alert("Failed to download QR code.");
    }
  };

  return (
    <div className="qrcode-section">
      <h3>Generate QR Code</h3>
      <p>
        <strong>QR Code for your menu:</strong>
      </p>
      <img ref={imgRef} src={qrUrl} alt="QR Code" id="qrimage" />
      <div style={{ marginTop: "1rem" }}>
        <button onClick={handleDownload}>Download QR Code</button>
      </div>
      <p>
        <small>
          Customers can scan this QR code to view your menu and place orders.
        </small>
      </p>

      {/* --- Analytics & Insights Section --- */}
      <div
        style={{
          marginTop: "2.5rem",
          background: "#fff",
          borderRadius: 8,
          boxShadow: "0 2px 12px rgba(0,0,0,0.07)",
          padding: "2rem",
          maxWidth: 600,
          marginLeft: "auto",
          marginRight: "auto",
        }}
      >
        <h3
          style={{
            color: "#2575fc",
            marginBottom: "1.2rem",
          }}
        >
          Analytics & Insights
        </h3>
        <div style={{ marginBottom: "1.5rem" }}>
          <b>Most Viewed Categories/Dishes</b>
          <ul
            style={{
              margin: "0.5rem 0 0 1.2rem",
            }}
          >
            <li>• Pizza (120 views)</li>
            <li>• Burgers (98 views)</li>
            <li>• Pasta (85 views)</li>
          </ul>
        </div>
        <div style={{ marginBottom: "1.5rem" }}>
          <b>Peak Scan Times</b>
          <ul
            style={{
              margin: "0.5rem 0 0 1.2rem",
            }}
          >
            <li>• 12:00 PM - 2:00 PM</li>
            <li>• 7:00 PM - 9:00 PM</li>
          </ul>
        </div>
        <div>
          <b>Customer Interaction Heatmap</b>
          <div
            style={{
              marginTop: "0.7rem",
              width: "100%",
              height: 80,
              background:
                "linear-gradient(90deg, #f97316 30%, #facc15 60%, #4ade80 100%)",
              borderRadius: 6,
              position: "relative",
            }}
          >
            <span
              style={{
                position: "absolute",
                left: 10,
                top: 10,
                color: "#fff",
                fontWeight: "bold",
                fontSize: 12,
              }}
            >
              Low
            </span>
            <span
              style={{
                position: "absolute",
                right: 10,
                top: 10,
                color: "#fff",
                fontWeight: "bold",
                fontSize: 12,
              }}
            >
              High
            </span>
            {/* This is a placeholder. Replace with a real heatmap/chart for production. */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default GenerateQRCodePage;
